    currentYearlyPlanDescriptionForAutoRenewCacelingWithRealPaiedUser: "\u0628\u0633\u062A\u0647 \u0641\u0639\u0644\u06CC\uFF1A{plan}\u062F\u0631 \u062A\u0627\u0631\u06CC\u062E {endAt} \u0645\u0646\u0642\u0636\u06CC \u0645\u06CC \u0634\u0648\u062F \u0648 \u067E\u0633 \u0627\u0632 \u0627\u0646\u0642\u0636\u0627 \u0628\u0647 \u0637\u0648\u0631 \u062E\u0648\u062F\u06A9\u0627\u0631 \u062A\u0645\u062F\u06CC\u062F \u0646\u0645\u06CC \u0634\u0648\u062F.<br/><1> \u0628\u0631\u0627\u06CC \u0645\u062F\u06CC\u0631\u06CC\u062A \u0628\u0631\u0646\u0627\u0645\u0647 \u0647\u0627\u06CC \u062A\u0645\u062F\u06CC\u062F \u0627\u06CC\u0646\u062C\u0627 \u0631\u0627 \u06A9\u0644\u06CC\u06A9 \u06A9\u0646\u06CC\u062F</1>",
    currentYearlyPlanDescriptionForAutoRenewCacelingWithAdmin: "\u0628\u0633\u062A\u0647 \u0641\u0639\u0644\u06CC\uFF1A{plan}\u062F\u0631 \u062A\u0627\u0631\u06CC\u062E {endAt} \u0645\u0646\u0642\u0636\u06CC \u0645\u06CC \u0634\u0648\u062F \u0648 \u067E\u0633 \u0627\u0632 \u0627\u0646\u0642\u0636\u0627 \u0628\u0647 \u0637\u0648\u0631 \u062E\u0648\u062F\u06A9\u0627\u0631 \u062A\u0645\u062F\u06CC\u062F \u0646\u0645\u06CC \u0634\u0648\u062F.<br/><1>\u0628\u0631\u0627\u06CC \u0641\u0639\u0627\u0644 \u06A9\u0631\u062F\u0646 \u0627\u0634\u062A\u0631\u0627\u06A9 \u0633\u0627\u0644\u0627\u0646\u0647 \u0645\u0633\u062A\u0645\u0631 \u0627\u06CC\u0646\u062C\u0627 \u0631\u0627 \u06A9\u0644\u06CC\u06A9 \u06A9\u0646\u06CC\u062F</1>",
    currentPlanDescriptionForOneTime: "\u0628\u0633\u062A\u0647 \u0641\u0639\u0644\u06CC\uFF1A{plan}\u0627\u0633\u062A \u0648 \u062F\u0631 {endAt} \u0645\u0646\u0642\u0636\u06CC \u0645\u06CC \u0634\u0648\u062F. <1> \u0628\u0631\u0627\u06CC \u0627\u0631\u062A\u0642\u0627\u0621 \u0628\u0647 \u0647\u0632\u06CC\u0646\u0647 \u0633\u0627\u0644\u0627\u0646\u0647 \u0627\u06CC\u0646\u062C\u0627 \u0631\u0627 \u06A9\u0644\u06CC\u06A9 \u06A9\u0646\u06CC\u062F</1> \u06CC\u0627 <2> \u0647\u0632\u06CC\u0646\u0647 \u0645\u0627\u0647\u0627\u0646\u0647</2> \u0639\u0636\u0648",
