    "desc.touchShortcutsToggleTranslatePageOnlyTranslation": "\u0641\u0642\u0637 \u0645\u062A\u0646 \u062A\u0631\u062C\u0645\u0647 \u0628\u0647 \u0645\u0639\u0646\u06CC \u0627\u0633\u062A \u06A9\u0647 \u0641\u0642\u0637 \u0645\u062A\u0646 \u062A\u0631\u062C\u0645\u0647 \u0646\u0645\u0627\u06CC\u0634 \u062F\u0627\u062F\u0647 \u0645\u06CC \u0634\u0648\u062F\u060C \u0627\u06AF\u0631 \u0635\u0641\u062D\u0647 \u0648\u0628 \u0647\u0646\u0648\u0632 \u062A\u0631\u062C\u0645\u0647 \u0646\u0634\u062F\u0647 \u0627\u0633\u062A\u060C \u062D\u0627\u0644\u062A \u062A\u063A\u06CC\u06CC\u0631 \u062E\u0648\u0627\u0647\u062F \u06A9\u0631\u062F \u0648 \u062A\u0631\u062C\u0645\u0647 \u062E\u0648\u0627\u0647\u062F \u0634\u062F.",
    "desc.toggleOnlyTransation": "\u062D\u0627\u0644\u062A \u0641\u0642\u0637 \u062A\u0631\u062C\u0645\u0647 \u0628\u0647 \u0627\u06CC\u0646 \u0645\u0639\u0646\u06CC \u0627\u0633\u062A \u06A9\u0647 \u0641\u0642\u0637 \u0645\u062A\u0646 \u062A\u0631\u062C\u0645\u0647 \u0634\u062F\u0647 \u0646\u0645\u0627\u06CC\u0634 \u062F\u0627\u062F\u0647 \u0645\u06CC \u0634\u0648\u062F\u060C \u0627\u06AF\u0631 \u0635\u0641\u062D\u0647 \u0648\u0628 \u0647\u0646\u0648\u0632 \u062A\u0631\u062C\u0645\u0647 \u0646\u0634\u062F\u0647 \u0628\u0627\u0634\u062F\u060C \u062D\u0627\u0644\u062A \u062A\u063A\u06CC\u06CC\u0631 \u062E\u0648\u0627\u0647\u062F \u06A9\u0631\u062F \u0648 \u062A\u0631\u062C\u0645\u0647 \u062E\u0648\u0627\u0647\u062F \u0634\u062F.",
