    download_started: "\u062F\u0627\u0646\u0644\u0648\u062F \u0634\u0631\u0648\u0639 \u0634\u062F\u0647 \u0627\u0633\u062A \u060C \u0627\u06AF\u0631 \u0628\u0647 \u0637\u0648\u0631 \u062E\u0648\u062F\u06A9\u0627\u0631 \u062F\u0627\u0646\u0644\u0648\u062F \u0646\u0634\u062F \u060C \u0644\u0637\u0641\u0627\u064B \u0628\u0647 \u0635\u0648\u0631\u062A \u062F\u0633\u062A\u06CC \u062F\u0627\u0646\u0644\u0648\u062F \u06A9\u0646\u06CC\u062F.",
