    "error.proTokenInvalid": "\u0627\u06AF\u0631 \u06A9\u0627\u0631\u0628\u0631 Pro \u0647\u0633\u062A\u06CC\u062F\u060C \u0644\u0637\u0641\u0627\u064B \u067E\u0633 \u0627\u0632 \u0648\u0631\u0648\u062F \u0627\u0632 \u062E\u062F\u0645\u0627\u062A \u062A\u0631\u062C\u0645\u0647 Pro \u0627\u0633\u062A\u0641\u0627\u062F\u0647 \u06A9\u0646\u06CC\u062F.",
