    enableSentryReport: "\u0648\u0642\u062A\u06CC \u062E\u0637\u0627\u06CC \u06AF\u0633\u062A\u0631\u0634 \u0631\u062E \u0645\u06CC \u062F\u0647\u062F\u060C \u0628\u0627 \u0627\u0633\u062A\u0641\u0627\u062F\u0647 \u0627\u0632 Sentry \u0628\u0631\u0627\u06CC \u0627\u0631\u0633\u0627\u0644 \u0628\u0627\u0632\u062E\u0648\u0631\u062F \u0627\u0633\u062A\u0641\u0627\u062F\u0647 \u06A9\u0646\u06CC\u062F.",
