    videoSubtitlePreTranslationOn: "\u0632\u06CC\u0631\u0646\u0648\u06CC\u0633 \u0647\u0627\u06CC \u0648\u06CC\u062F\u06CC\u0648 \u0628\u0647 \u0637\u0648\u0631 \u0627\u0648\u0644\u0648\u06CC\u062A\u06CC \u0627\u0632 \u062A\u0631\u062C\u0645\u0647 \u0641\u0631\u0648 \u0631\u0641\u062A\u06AF\u06CC \u0627\u0633\u062A\u0641\u0627\u062F\u0647 \u062E\u0648\u0627\u0647\u062F \u06A9\u0631\u062F.",
