    "error.502": "\u062E\u062F\u0645\u062A \u062E\u0637\u0627 \u062F\u0627\u062F\u0647 \u0627\u0633\u062A\u060C \u062E\u062F\u0645\u062A \u0628\u0647 \u062A\u0627\u062E\u06CC\u0631 \u0627\u0641\u062A\u0627\u062F\u0647 \u0627\u0633\u062A\u060C \u0644\u0637\u0641\u0627 \u0628\u0639\u062F\u0627 \u062F\u0648\u0628\u0627\u0631\u0647 \u0627\u0645\u062A\u062D\u0627\u0646 \u06A9\u0646\u06CC\u062F.",
