    "translationModeLang.translation.description": "\u0648\u0642\u062A\u06CC \u0632\u0628\u0627\u0646 \u0635\u0641\u062D\u0647 \u0628\u0647 \u0632\u0628\u0627\u0646\u0647\u0627\u06CC \u0632\u06CC\u0631 \u0627\u0633\u062A\u060C \u0628\u0647 \u0637\u0648\u0631 \u062E\u0648\u062F\u06A9\u0627\u0631 \u0627\u0632 \u062D\u0627\u0644\u062A \u062A\u0631\u062C\u0645\u0647 \u0641\u0642\u0637 \u0627\u0633\u062A\u0641\u0627\u062F\u0647 \u0645\u06CC \u0634\u0648\u062F",
    "error.429": "\u062E\u062F\u0645\u062A \u062E\u0637\u0627 \u0631\u0627 \u0628\u0631\u0645\u06CC \u06AF\u0631\u062F\u0627\u0646\u062F\u060C \u06A9\u0647 \u0646\u0634\u0627\u0646 \u0645\u06CC \u062F\u0647\u062F \u062F\u0631\u062E\u0648\u0627\u0633\u062A \u0628\u06CC\u0634 \u0627\u0632 \u062D\u062F \u0645\u06A9\u0631\u0631 \u06CC\u0627 \u0628\u06CC\u0634 \u0627\u0632 \u062D\u062F \u0645\u062D\u062F\u0648\u062F\u06CC\u062A \u0627\u0633\u062A\u060C \u0644\u0637\u0641\u0627 \u0628\u0639\u062F\u0627 \u062F\u0648\u0628\u0627\u0631\u0647 \u0627\u0645\u062A\u062D\u0627\u0646 \u06A9\u0646\u06CC\u062F.",
