    "translationFont.notSupportErrorMessage": "\u0644\u0637\u0641\u0627\u064B \u0646\u0627\u0645 \u0641\u0648\u0646\u062A\u06CC \u06A9\u0647 \u0648\u0627\u0631\u062F \u06A9\u0631\u062F\u0647 \u0627\u06CC\u062F \u0631\u0627 \u0628\u0631\u0631\u0633\u06CC \u06A9\u0646\u06CC\u062F \u062A\u0627 \u0645\u0637\u0645\u0626\u0646 \u0634\u0648\u06CC\u062F \u06A9\u0647 \u062F\u0631\u0633\u062A \u0627\u0633\u062A\u060C \u06CC\u0627 \u062A\u0623\u06CC\u06CC\u062F \u06A9\u0646\u06CC\u062F \u06A9\u0647 \u0627\u06CC\u0646 \u0641\u0648\u0646\u062A \u0628\u0631 \u0631\u0648\u06CC \u062F\u0633\u062A\u06AF\u0627\u0647 \u0634\u0645\u0627 \u0646\u0635\u0628 \u0634\u062F\u0647 \u0627\u0633\u062A.",
    "error.gemini.429": "\u062E\u062F\u0645\u062A Gemini \u062F\u0631 \u062D\u0627\u0644 \u062D\u0627\u0636\u0631 \u0628\u0647 \u0638\u0631\u0641\u06CC\u062A \u062D\u062F\u0627\u06A9\u062B\u0631\u06CC \u062E\u0648\u062F \u0631\u0633\u06CC\u062F\u0647 \u0627\u0633\u062A\u060C \u0644\u0637\u0641\u0627\u064B \u0628\u0639\u062F\u0627\u064B \u062F\u0648\u0628\u0627\u0631\u0647 \u0627\u0645\u062A\u062D\u0627\u0646 \u06A9\u0646\u06CC\u062F \u06CC\u0627 \u0628\u0647 \u0633\u0631\u0648\u06CC\u0633 \u062A\u0631\u062C\u0645\u0647 \u062F\u06CC\u06AF\u0631\u06CC \u062A\u063A\u06CC\u06CC\u0631 \u062F\u0647\u06CC\u062F.",
    "desc.toggleVideoSubtitlePreTranslation": "\u0628\u0639\u062F \u0641\u0634\u0627\u0631\u060C \u0632\u06CC\u0631\u0646\u0648\u06CC\u0633 \u062F\u0648\u0632\u0628\u0627\u0646\u0647 \u0648\u06CC\u062F\u06CC\u0648 \u0627\u0648\u0644\u0648\u06CC\u062A \u0627\u0633\u062A\u0641\u0627\u062F\u0647 \u0627\u0632 \u062A\u0646\u0638\u06CC\u0645\u0627\u062A \u062A\u0631\u062C\u0645\u0647 \u063A\u0648\u0637\u0647 \u0648\u0631 \u062E\u0648\u0627\u0647\u062F \u062F\u0627\u0634\u062A\u060C \u0628\u0627 \u0641\u0634\u0627\u0631 \u062F\u0648\u0628\u0627\u0631\u0647\u060C \u0627\u0648\u0644\u0648\u06CC\u062A \u0627\u0633\u062A\u0641\u0627\u062F\u0647 \u0627\u0632 \u0632\u06CC\u0631\u0646\u0648\u06CC\u0633 \u0645\u0627\u0634\u06CC\u0646\u06CC \u0627\u0635\u0644\u06CC \u0648\u06CC\u062F\u06CC\u0648 \u062E\u0648\u0627\u0647\u062F \u0628\u0648\u062F\u060C \u062A\u0648\u062C\u0647 \u062F\u0627\u0634\u062A\u0647 \u0628\u0627\u0634\u06CC\u062F: \u0627\u06CC\u0646 \u0645\u06CC\u0627\u0646\u0628\u0631 \u062A\u0646\u0638\u06CC\u0645\u0627\u062A \u062C\u0647\u0627\u0646\u06CC \u0631\u0627 \u062A\u063A\u06CC\u06CC\u0631 \u0645\u06CC \u062F\u0647\u062F.",
