    touchShortcutsToggleTranslatePage: "\u0628\u0631\u0627\u06CC \u062A\u0631\u062C\u0645\u0647 \u0635\u0641\u062D\u0627\u062A \u0648\u0628 / \u0646\u0645\u0627\u06CC\u0634 \u0645\u062A\u0646 \u0627\u0635\u0644\u06CC \u060C \u062D\u0631\u06A9\u062A \u0647\u0627\u06CC \u0644\u0645\u0633\u06CC \u0631\u0627 \u062A\u0646\u0638\u06CC\u0645 \u06A9\u0646\u06CC\u062F",
