    "browser.toggleMouseHoverTranslateDirectly": "\u062F\u0631 \u0635\u0641\u062D\u0647\u060C \u0628\u0647 \u0637\u0648\u0631 \u0645\u0648\u0642\u062A \u0641\u0639\u0627\u0644 \u06CC\u0627 \u063A\u06CC\u0631\u0641\u0639\u0627\u0644 \u06A9\u0631\u062F\u0646 \u062A\u0631\u062C\u0645\u0647 \u0645\u0633\u062A\u0642\u06CC\u0645 \u0645\u0648\u0633 \u0647\u0646\u06AF\u0627\u0645 \u0627\u0634\u0627\u0631\u0647",
