    "floatBall.longPress": "\u0628\u0627 \u0641\u0634\u0627\u0631 \u0637\u0648\u0644\u0627\u0646\u06CC \u0645\u06CC \u062A\u0648\u0627\u0646\u06CC\u062F \u0628\u0647 \u0633\u0631\u0639\u062A \u067E\u0646\u0644 \u062A\u0646\u0638\u06CC\u0645\u0627\u062A \u0631\u0627 \u0628\u0627\u0632 \u06A9\u0646\u06CC\u062F",
    "desc.touchShortcutsToggleTranslateTouchElement": "\u06CC\u06A9 \u062D\u0631\u06A9\u062A \u062F\u0633\u062A \u0633\u0641\u0627\u0631\u0634\u06CC \u062A\u0639\u0631\u06CC\u0641 \u06A9\u0646\u06CC\u062F\u060C \u062A\u0627 \u0628\u062A\u0648\u0627\u0646\u06CC\u062F \u0647\u0631 \u067E\u0627\u0631\u0627\u06AF\u0631\u0627\u0641\u06CC \u0631\u0627 \u062F\u0631 \u0645\u062D\u0644 \u062E\u0648\u062F \u062A\u0631\u062C\u0645\u0647 \u06A9\u0646\u06CC\u062F",
    "desc.interfaceLanguage": "\u062A\u0646\u0638\u06CC\u0645 \u0632\u0628\u0627\u0646 \u0631\u0627\u0628\u0637 \u062A\u0623\u062B\u06CC\u0631 \u0628\u0631 \u0632\u0628\u0627\u0646 \u0646\u0645\u0627\u06CC\u0634 \u067E\u0646\u0644 \u06A9\u0646\u062A\u0631\u0644 \u062F\u0627\u0631\u062F \u0648 \u0628\u0627 \u0632\u0628\u0627\u0646 \u0647\u062F\u0641 \u062A\u0631\u062C\u0645\u0647 \u0627\u0631\u062A\u0628\u0627\u0637\u06CC \u0646\u062F\u0627\u0631\u062F.",
    "error.subscriptionExpired": "\u0639\u0636\u0648\u06CC\u062A \u0634\u0645\u0627 \u0645\u0645\u06A9\u0646 \u0627\u0633\u062A \u0645\u0646\u0642\u0636\u06CC \u0634\u062F\u0647 \u0628\u0627\u0634\u062F\u060C \u0644\u0637\u0641\u0627 \u0648\u0636\u0639\u06CC\u062A \u0639\u0636\u0648\u06CC\u062A \u062E\u0648\u062F \u0631\u0627 \u0628\u0631\u0631\u0633\u06CC \u06A9\u0646\u06CC\u062F.",
