    "transitionMode.inherit": "\u0628\u0627 \u062D\u0627\u0644\u062A \u0646\u0645\u0627\u06CC\u0634 \u067E\u06CC\u0634 \u0641\u0631\u0636 \u0633\u06CC\u0633\u062A\u0645 \u0647\u0645\u0627\u0647\u0646\u06AF \u0628\u0645\u0627\u0646\u06CC\u062F",
