    "subtitle.transitionModeDescription": "\u062A\u0646\u0638\u06CC\u0645 \u0632\u06CC\u0631\u0646\u0648\u06CC\u0633 \u0648\u06CC\u062F\u06CC\u0648 \u0628\u0647 \u062D\u0627\u0644\u062A \u0645\u0642\u0627\u0628\u0644\u0647 \u062F\u0648\u0632\u0628\u0627\u0646\u0647 \u06CC\u0627 \u0641\u0642\u0637 \u062D\u0627\u0644\u062A \u062A\u0631\u062C\u0645\u0647",
