    "browser.brandDescriptionForSafari": "\u3010\u062A\u0631\u062C\u0645\u0647 \u0641\u0631\u0648 \u0631\u0641\u062A\u0647\u3011 \u06CC\u06A9 \u0627\u0641\u0632\u0648\u0646\u0647 \u062A\u0631\u062C\u0645\u0647 \u0635\u0641\u062D\u0647 \u0648\u0628 \u062F\u0648\u0632\u0628\u0627\u0646\u0647 \u0631\u0627\u06CC\u06AF\u0627\u0646 (\u0645\u062A\u0646 \u0627\u0635\u0644\u06CC / \u062A\u0631\u062C\u0645\u0647) \u060C \u062F\u0631 \u0639\u06CC\u0646 \u062D\u0627\u0644 \u067E\u0634\u062A\u06CC\u0628\u0627\u0646\u06CC \u0627\u0632 \u062A\u0631\u062C\u0645\u0647 PDF \u0648 \u062A\u0631\u062C\u0645\u0647 \u06A9\u062A\u0627\u0628 \u0627\u0644\u06A9\u062A\u0631\u0648\u0646\u06CC\u06A9\u06CC EPUB \u0628\u0627 \u062D\u0641\u0638 \u0637\u0631\u062D \u0628\u0646\u062F\u06CC \u0627\u0635\u0644\u06CC \u0633\u0646\u062F \u060C \u062A\u0631\u062C\u0645\u0647 \u0632\u06CC\u0631\u0646\u0648\u06CC\u0633 \u062F\u0648\u0632\u0628\u0627\u0646\u0647 \u0648\u06CC\u062F\u0626\u0648\u06CC \u0622\u0646\u0644\u0627\u06CC\u0646 Youtube / Netflix \u060C \u067E\u0634\u062A\u06CC\u0628\u0627\u0646\u06CC \u0627\u0632 \u062E\u062F\u0645\u0627\u062A \u062A\u0631\u062C\u0645\u0647 \u0627\u0635\u0644\u06CC Deepl / Google\u061B",
